import React from 'react';
import { TodoListItem }from './TodoListItem'

const todos: Todo[] = [{
  text: 'hihi',
  isCompleted: false
},{
  text: 'rolling',
  isCompleted: false
},
]

const App: React.FC = () => {
  return <>
 <TodoListItem todo={todos[0]} />
  </>
}

export default App;
